import { HeartOutlined } from "@ant-design/icons";
import { Card, Rate } from "antd";


const Comment = () => {
    return(
        <div>
            <Card
              title="Comment"
              bordered={false}
              style={{
                width: 300,
              }}
            >
                 <Rate character={<HeartOutlined />} />
            </Card>
        </div>
    );
};

export default Comment;
